create table countries
(
    id              serial,
    name            varchar,
    iso3            varchar,
    numeric_code    varchar,
    iso2            varchar,
    phonecode       varchar,
    currency        varchar,
    currency_symbol varchar,
    region          varchar,
    latitude        numeric(10, 8) default NULL::numeric,
    longitude       numeric(11, 8) default NULL::numeric
);

alter table countries
    owner to hotel_checker;

